/**
=========================================================
* Soft UI Dashboard PRO React - v2.0.0
=========================================================

* Product Page: https://www.creative-tim.com/product/soft-ui-dashboard-pro-material-ui
* Copyright 2021 Creative Tim (https://www.creative-tim.com)

Coded by www.creative-tim.com

 =========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.
*/

// @mui material components
import Grid from "@mui/material/Grid";

// Soft UI Dashboard PRO React components
import SuiBox from "components/SuiBox";
// import SuiTypography from "components/SuiTypography";
// import SuiButton from "components/SuiButton";

// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";

// EditProduct page components
// import ProductImage from "layouts/ecommerce/products/edit-product/components/ProductImage";
// import ProductInfo from "layouts/ecommerce/products/edit-product/components/ProductInfo";
// import Socials from "layouts/ecommerce/products/edit-product/components/Socials";
// import Pricing from "layouts/ecommerce/products/edit-product/components/Pricing";
import { Table } from 'react-bootstrap';


function Pan() {


    return (
        <DashboardLayout>
            <DashboardNavbar />
            <SuiBox my={3}>

                <Grid container>
                    <Table striped bordered hover style={{ textAlign: 'center' }}>

                        <thead>
                            <tr>
                                <th style={{ backgroundColor: 'brown', color: 'white', padding: '15px' }}>Name</th>

                                <th style={{ backgroundColor: 'brown', color: 'white', padding: '15px' }}>Mobile</th>

                                <th style={{ backgroundColor: 'brown', color: 'white', padding: '15px' }}>PAN</th>

                                <th style={{ backgroundColor: 'brown', color: 'white', padding: '15px' }}>Tax Status</th>

                                <th style={{ backgroundColor: 'brown', color: 'white', padding: '15px' }}>Email</th>

                                <th style={{ backgroundColor: 'brown', color: 'white', padding: '15px' }}>Created On</th>

                                <th style={{ backgroundColor: 'brown', color: 'white', padding: '15px' }}>FE User Id</th>

                                <th style={{ backgroundColor: 'brown', color: 'white', padding: '15px' }}>BSE Client ID</th>

                                <th style={{ backgroundColor: 'brown', color: 'white', padding: '15px' }}>KYC</th>

                                <th style={{ backgroundColor: 'brown', color: 'white', padding: '15px' }}>Bank</th>

                                <th style={{ backgroundColor: 'brown', color: 'white', padding: '15px' }}>AOF</th>

                                <th style={{ backgroundColor: 'brown', color: 'white', padding: '15px' }}>FATCA</th>

                                <th style={{ backgroundColor: 'brown', color: 'white', padding: '15px' }}>Mandate</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td style={{ padding: '15px' }}><a href="/user/view/432847" target="_blank">KAUSTUBH BHATTAD</a></td>


                                <td>9789916097</td>

                                <td>GHHPB2700Q</td>

                                <td >Individual</td>

                                <td>kaustubhbhatted@gmail.com</td>

                                <td>May 10, 2022, 1:08 PM</td>

                                <td>432847</td>

                                <td >K432847</td>

                                <td>kyc</td>

                                <td >Yes</td>

                                <td>Yes</td>

                                <td>Yes</td>

                                <td>No</td>
                            </tr>
                        </tbody>
                    </Table>
                </Grid>
            </SuiBox>
            <Footer />
        </DashboardLayout>
    );
}

export default Pan;
